script: |
  super -f text -I q585.spq | sort > q585.out

inputs:
  - name: q585.spq
    data: |
      SELECT DISTINCT - col0 * col0 * col1 - col2 AS col2 FROM tab0 (FORMAT parquet) WHERE NOT NULL BETWEEN ( - col1 * col1 * col2 ) AND ( + col0 * + col2 * + col1 - col0 );
  - name: tab0

outputs:
  - name: q585.out
    data: |
